import React from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
    const navigate = useNavigate();

    const handleNavigation = (path) => {
        navigate(path);
    };

    return (
        <div>
            <h1>Dashboard</h1>
            <button onClick={() => handleNavigation('/dashboard/components/Profile')}>Profile</button>
            <button onClick={() => handleNavigation('/dashboard/chat')}>Chat</button>
            <button onClick={() => handleNavigation('/dashboard/settings')}>Settings</button>
            <button onClick={() => handleNavigation('/dashboard/appointments')}>Appointments</button>
        </div>
    );
};

export default Dashboard;
